using System;
using Newtonsoft.Json;
using Newtonsoft.Json.Linq;

public static class Snippet
{
	public static void func(System.String myJson, ref System.String signaturevalue, ref System.String signaturecounter, ref System.String signaturelogtime)
	{

		JObject obj = JObject.Parse(myJson);
		signaturevalue = obj.GetValue("signatureValue").ToString();
		signaturecounter = obj.GetValue("signatureCounter").ToString();
		signaturelogtime = obj.GetValue("logTime").ToString();

	}

}
